import React from "react";
import '../style.css'

function NavBar (){
  return (
    <nav className="nav">
      <a href="/" className="site-title"></a>
     <ul>
       <li>
         <Link to = "/">Home</Link>
         {/* <a href="/search">Search</a> */}
       </li>

       <li>
         {/* <a href="/contact">Contact Us</a> */}
         <Link to = "/search">SearchForm</Link>
       </li>

       <li>
         {/* <a href="/about">About</a> */}
         <Link to = "/contact">SearchForm</Link>
       </li>
     </ul>

    </nav>
  )
}

export default NavBar ;
